import React, { useEffect, useState } from 'react';
import firebase from 'firebase'; // Import the Firebase SDK and initialize it in your app

// Assuming you have initialized Firebase and obtained a reference to your Firestore database

const YourComponent = () => {
  const [employeeData, setEmployeeData] = useState([]);

  // Fetch data from Firebase and update the state
  useEffect(() => {
    const fetchData = async () => {
      try {
        const employeesRef = firebase.firestore().collection('employees');
        const snapshot = await employeesRef.get();

        const data = snapshot.docs.map((doc) => ({
          id: doc.id,
          ...doc.data(),
        }));

        setEmployeeData(data);
      } catch (error) {
        console.error('Error!Contact ', error);
      }
    };

    fetchData();
  }, []);

  return (
    <div className="table-responsive">
      <table className="table display data-table text-nowrap">
        <thead>
          <tr>
            <th>Full Name</th>
            <th>Employee ID</th>
            <th>Gender</th>
            <th>Date of Birth</th>
            <th>Address</th>
            <th>Phone Number</th>
            <th>Email Address</th>
            <th>Marital Status</th>
            <th>National ID Number</th>
            <th>Passport Info</th>
            <th>Emergency Contact</th>
            <th>Bank Name</th>
            <th>Bank Account Number</th>
            <th>Account Type</th>
            <th>Bank Branch</th>
            <th>IFSC Code</th>
            <th>SWIFT Code</th>
            <th>Bank Address</th>
            <th>MICR Code</th>
            <th>PT</th>
            <th>PF</th>
            <th>ESI</th>
            <th>Residency Status</th>
            <th>Employment Start Date</th>
            <th>Employment Status</th>
            <th>Job Title</th>
            <th>Department</th>
            <th>Reporting Manager</th>
            <th>Salary Details</th>
            <th>Update</th>
            <th>Delete</th>
          </tr>
        </thead>
        <tbody>
          {employeeData.map((employee) => (
            <tr key={employee.id}>
              <td>{employee.fullName}</td>
              <td>{employee.employeeId}</td>
              <td>{employee.gender}</td>
              <td>{employee.dateOfBirth}</td>
              <td>{employee.address}</td>
              <td>{employee.phoneNumber}</td>
              <td>{employee.emailAddress}</td>
              <td>{employee.maritalStatus}</td>
              <td>{employee.nationalIdNumber}</td>
              <td>{employee.passportInfo}</td>
              <td>{employee.emergencyContact}</td>
              <td>{employee.bankName}</td>
              <td>{employee.bankAccountNumber}</td>
              <td>{employee.accountType}</td>
              <td>{employee.bankBranch}</td>
              <td>{employee.ifscCode}</td>
              <td>{employee.swiftCode}</td>
              <td>{employee.bankAddress}</td>
              <td>{employee.micrCode}</td>
              <td>{employee.pt}</td>
              <td>{employee.pf}</td>
              <td>{employee.esi}</td>
              <td>{employee.residencyStatus}</td>
              <td>{employee.employmentStartDate}</td>
              <td>{employee.employmentStatus}</td>
              <td>{employee.jobTitle}</td>
              <td>{employee.department}</td>
              <td>{employee.reportingManager}</td>
              <td>{employee.salary}</td>
              <td>Update</td>
              <td>Delete</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default YourComponent;
